import React from 'react';
import { Link } from 'react-router-dom';
import { X, User, ChevronRight } from 'lucide-react';

const Sidebar = ({ isOpen, onClose, user, categories }) => {
  return (
    <>
      {/* 1. OVERLAY (Dark background when sidebar is open) */}
      {isOpen && (
        <div 
          onClick={onClose} 
          style={overlayStyle} 
        />
      )}

      {/* 2. SIDEBAR CONTAINER */}
      <div style={{ 
        ...sidebarContainer, 
        left: isOpen ? '0' : '-300px' 
      }}>
        
        {/* HEADER: User Profile Info */}
        <div style={sidebarHeader}>
          <User size={24} color="white" />
          <span style={headerText}>
            {user ? `Hello, ${user.email.split('@')[0]}` : 'Hello, Sign In'}
          </span>
          <X 
            size={24} 
            onClick={onClose} 
            style={{ cursor: 'pointer', marginLeft: 'auto' }} 
          />
        </div>

        {/* CONTENT: Categories List */}
        <div style={sidebarContent}>
          <h3 style={sectionTitle}>Shop By Category</h3>
          
          <ul style={categoryList}>
            {categories.length > 0 ? (
              categories.map((cat) => (
                <li key={cat} style={listItem}>
                  <Link 
                    to={`/category/${cat}`} 
                    onClick={onClose} 
                    style={navLink}
                  >
                    {cat.charAt(0).toUpperCase() + cat.slice(1)}
                    <ChevronRight size={16} color="#888" />
                  </Link>
                </li>
              ))
            ) : (
              <p style={{ padding: '0 20px', fontSize: '14px', color: '#888' }}>
                Loading categories...
              </p>
            )}
          </ul>

          <hr style={{ border: 'none', borderTop: '1px solid #eee', margin: '10px 0' }} />
          
          <h3 style={sectionTitle}>Help & Settings</h3>
          <ul style={categoryList}>
            <li style={listItem}>
              <Link to="/profile" onClick={onClose} style={navLink}>Your Account</Link>
            </li>
            <li style={listItem}>
              <Link to="/login" onClick={onClose} style={navLink}>Sign In / Register</Link>
            </li>
          </ul>
        </div>
      </div>
    </>
  );
};

// --- STYLES ---

const overlayStyle = {
  position: 'fixed',
  top: 0,
  left: 0,
  width: '100%',
  height: '100%',
  backgroundColor: 'rgba(0,0,0,0.6)',
  zIndex: 999,
  transition: '0.3s'
};

const sidebarContainer = {
  position: 'fixed',
  top: 0,
  width: '280px',
  height: '100%',
  backgroundColor: 'white',
  zIndex: 1000,
  transition: '0.3s ease-in-out',
  boxShadow: '4px 0 10px rgba(0,0,0,0.1)',
  display: 'flex',
  flexDirection: 'column'
};

const sidebarHeader = {
  backgroundColor: '#232f3e',
  color: 'white',
  padding: '15px 20px',
  display: 'flex',
  alignItems: 'center',
  gap: '12px',
  fontSize: '18px',
  fontWeight: 'bold'
};

const headerText = {
  overflow: 'hidden',
  textOverflow: 'ellipsis',
  whiteSpace: 'nowrap',
  maxWidth: '160px'
};

const sidebarContent = {
  flex: 1,
  overflowY: 'auto',
  padding: '10px 0'
};

const sectionTitle = {
  fontSize: '16px',
  fontWeight: 'bold',
  padding: '15px 20px 5px',
  margin: 0,
  color: '#111'
};

const categoryList = {
  listStyle: 'none',
  padding: 0,
  margin: 0
};

const listItem = {
  display: 'flex'
};

const navLink = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  padding: '12px 20px',
  textDecoration: 'none',
  color: '#333',
  fontSize: '14px',
  transition: '0.2s',
  borderBottom: '1px solid #f9f9f9'
};

export default Sidebar;
